            <div className="profile-details">
                <div className="profile-details-text">
                    <h1>{profile.first_name} {profile.last_name}</h1>
                    <h5>{profile.username}</h5>
                    <h3>Email- {profile.email}</h3>
                </div>
                <h1>My list</h1>
                <Viewmyngo />
            </div>
        )
    }
}
